import { defaultFont } from "assets/jss/material-kit-react.jsx";

const headerLinkStyle = theme => ({
	list: {
		...defaultFont,
		fontSize: "14px",
		margin: 0,
		paddingLeft: "0",
		listStyle: "none",
		paddingTop: "0",
		paddingBottom: "0",
		color: "inherit"
	},
	listItem: {
		float: "left",
		color: "inherit",
		position: "relative",
		display: "block",
		width: "auto",
		margin: "0",
		padding: "0"
	},
	listItemText: {
		padding: "0 !important"
	},
	navLink: {
		color: "inherit",
		position: "relative",
		padding: "0.9375rem",
		fontWeight: "400",
		fontSize: "12px",
		textTransform: "uppercase",
		borderRadius: "3px",
		lineHeight: "20px",
		textDecoration: "none",
		margin: "0px",
		display: "inline-flex",
		"&:hover, &:focus": {
			color: "inherit",
			background: "rgba(200, 200, 200, 0.2)"
		}
	},
	icons: {
		width: "20px",
		height: "20px",
		marginRight: "3px"
	},
})

export default headerLinkStyle;
